    <Router>
      <div className="flex h-screen">
        {/* Sidebar */}
        <Sidebar setSelectedContent={(val) =>{} } menuItems={[]} selectedContent={[]} />

        {/* Main Content */}
        <div className="flex-1 p-6">
          <Routes>
            <Route path="/" element={ 'home'} />
            <Route path="/about" element={'about'} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
